  <style>
    * {
      margin: 0;
      padding: 0;
      -webkit-box-sizing: border-box;
      box-sizing: border-box;
      font-family: sans-serif;
      font-size: 100.06% !important;
      line-height: 126.16% !important;
    }

    body {
      font-family: Arial, 'Helvetica Neue', Helvetica, sans-serif;
      font-size: 1rem;
      line-height: 1.2;
      color: #fff;
      background-color: #000090;
      overflow: hidden;
      margin: 0 auto;
      max-width: 600px;
      position: relative
    }

    p {
      margin: 0 0 .33rem
    }

    main {
      min-height: calc(100vh - 90px);
      display: flex;
      flex-direction: column
    }

    .pagination {
      margin: 1rem;
      display: flex;
      flex-wrap: nowrap
    }

    .pagination>i {
      font-style: normal;
      display: inline-block;
      padding: 3px 8px;
      margin-right: .5rem;
      border: 1px solid #004be8;
      background: #000090;
      color: #fff;
      font-size: large;
      flex-grow: 1
    }

    .pagination>i.active {
      border-color: #fff;
      background: #0000da
    }

    header .icon {
      padding: .5rem;
      background-color: rgba(255, 255, 255, .2)
    }

    header {
      display: flex;
      flex-wrap: wrap;
      justify-content: space-between;
      align-items: center;
      padding: 7px;
      max-width: 420px;
      margin: 0 auto
    }

    header .slogan {
      flex-basis: 100%;
      font-size: 12px;
      overflow: hidden;
      text-align: center;
      text-overflow: ellipsis;
      white-space: nowrap
    }

    .main__item {
      padding: 0 1rem;
      margin-bottom: 1em;
      flex: 1 1 auto;
      display: flex;
      flex-direction: column
    }

    .main__title {
      padding: 0
    }

    .main__image {
      overflow: hidden;
      position: relative;
      flex: 1 1 auto;
      min-height: 220px
    }

    .main__image .image {
      filter: blur(30px);
      position: absolute;
      top: 50%;
      left: 50%;
      transform: translate(-50%, -50%);
      min-height: 100%;
      min-width: 100%
    }

    .author {
      font-size: large;
      font-weight: 700;
      color: #5c99fe
    }

    .title {
      font-size: 1.25em
    }

    .meta {
      display: flex;
      justify-content: space-between;
      color: #5c99fe;
      font-size: 1.05em
    }

    .pl {
      display: flex;
      flex-grow: 1;
      margin-top: 10px;
      min-height: 212px;
      position: absolute;
      top: 0;
      left: 0;
      width: 100%;
      height: 100%;
      z-index: 2
    }

    .pl__cnt {
      background-size: contain;
      background-position: center center;
      background-repeat: no-repeat;
      flex-grow: 1
    }

    .pl__cnt {
      align-items: center;
      display: flex;
      justify-content: center;
      position: relative
    }

    .pl__ctr {
      align-items: center;
      bottom: 0;
      display: flex;
      height: 50px;
      position: absolute;
      width: 100%
    }

    .pl__ctr-tm {
      font-size: 11px;
      margin: 0 20px 0 15px
    }

    .pl__ctr-bar {
      background-color: #3f3f3f;
      flex-grow: 1;
      height: 2px;
      margin-right: 15px;
      position: relative
    }

    .pl__ctr-bar:before {
      background-color: #fff;
      border-radius: 50%;
      content: '';
      cursor: pointer;
      height: 16px;
      left: -8px;
      position: absolute;
      top: -8px;
      width: 16px;
      z-index: 1
    }

    .pl__ctr-bar-line {
      -webkit-animation: a 5s both;
      animation: a 5s both;
      background-color: #9f9f9f;
      height: 100%;
      left: 0;
      position: absolute;
      transform-origin: left;
      width: 85%
    }

    .pl__ctr-ic {
      cursor: pointer;
      fill: #fff
    }

    .pl__ctr-ic.hd {
      background-color: #000;
      border-radius: 4px;
      fill: #b6d4f0;
      height: 16px;
      width: 33px
    }

    .pl__ctr-ic.mute {
      height: 14px;
      margin: 0 15px
    }

    .pl__ctr-ic.resize {
      height: 18px;
      margin-right: 15px
    }

    .lst__t {
      font-size: large;
      font-weight: 700;
      padding: 0 10px
    }

    .lst__w-i {
      display: flex
    }

    .lst__i {
      background: #292929;
      border-radius: 4px;
      margin: 5px;
      padding: 7px;
      width: 100%;
      overflow: hidden
